import SignUp from '../components/SignUp/SignUp';

const SignUpContainer = () => {

    return (
        <div style={{
            justifyContent: "center",
            display: "flex",
            padding: "35px",
        }}>
            <SignUp />
        </div>
    )
}

export default SignUpContainer;
